import Link from "next/link";

const Header = () => (
  <>
    <div className="navbar">
      <div className="wrapper">
        <Link href="/">
          <a className="navlink">Home</a>
        </Link>
        <Link href="/about">
          <a className="navlink">About</a>
        </Link>
      </div>
    </div>
    <style jsx>
      {`
        .wrapper {
          display: flex;
          align-items: center;
          flex-direction: column;
          justify-content: center;
          height: 100px;
          position: absolute;
          text-align: center;
          width: 50px;
        }

        .navlink {
          color: #2699fb;
          font-family: "Arial";
          margin: 35px 0;
          text-decoration: none;
          transform: rotate(-90deg);
        }

        .navlink:hover {
          opacity: 0.6;
        }
      `}
    </style>
  </>
);

export default Header;
